import React from 'react';
import PersonIcon from '@mui/icons-material/Person';
import ForumIcon from '@mui/icons-material/Forum';


function Header() {
    return (
        <div>
            <h2>I am a Header</h2>
            <PersonIcon />
            <ForumIcon />
        </div>
    );
}

export default Header;
